A task can be defined by creating a new package inside lib/tasks, and which defines the run procedure. The run procedure will receive a list of all command line arguments passed, according to the user's terminal. You can use these tasks in project.odin as a way to access internal lib data or procedures. Example Task package Tasks_Version import "core:fmt"
import "project:config"
import "../options" run :: proc(args: options.Options) { fmt.printfln("%s\n%s\n%s", config.COPYRIGHT, config.AUTHORS, config.WEBSITE)
}
